&quot;Excellence In Obedience&quot;
Bailey Blue

Bailey's been around the DungeonCorp block a bit, so to speak, she's a fine woman. Her beautiful body and attitude always make it a pleasure to have her. This week, she gets to work with the man himself Ogre. We witness it all as he binds her tightly and runs her though her paces. A tirade of whips ensues, reddening her flesh...Orgasms are abound as he pushes her to her limits. And Bailey duly suffers for him, exhibiting an excellence in obedience that is rarely found. Nothing is held back as the leather flies swiftly and Bailey suffers for her rewards...enduring her punishment all the way...

